(window.webpackJsonp=window.webpackJsonp||[]).push([[23],{312:function(t,e,o){"use strict";o.r(e),e.default='<p>在这里你可以找到 <strong>webpack</strong> 项目的品牌指南、资源和许可证。有关更多信息，请通过查看我们的官方<a href="https://github.com/webpack/media">媒资仓库</a>，并找到<a href="https://github.com/webpack/media/blob/master/LICENSE">许可证</a>来了解。点击任意图片下载它们。</p>\n<h2 id="名称">名称<a href="#%E5%90%8D%E7%A7%B0" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p>webpack 应当<strong>总是</strong>以小写字母书写，即使在一句话的起始位置也是如此。</p>\n<h2 id="logo">Logo<a href="#logo" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p>webpack logo 应放置在白色背景上，并且其周围有足够间距，如下所示:</p>\n<img src="https://raw.githubusercontent.com/webpack/media/master/logo/logo-on-white-bg.png" alt="webpack logo default with proper spacing on light background" />\n<p><a href="https://github.com/webpack/media/blob/master/logo/logo-on-white-bg.svg">svg</a> | <a href="https://github.com/webpack/media/blob/master/logo/logo-on-white-bg.png">png</a> | <a href="https://github.com/webpack/media/blob/master/logo/logo-on-white-bg.jpg">jpg</a></p>\n<p>只需将内部深蓝色正方体的大小加倍，就可以知道 logo 应占据多大空间。</p>\n<p>对于深色背景，可以使用 logo 的反色版本：</p>\n<div style="display: block; background: #111;">\n  <img src="https://raw.githubusercontent.com/webpack/media/master/logo/logo-on-dark-bg.png" alt="webpack logo default with proper spacing on light background" />\n</div>\n<p><a href="https://github.com/webpack/media/blob/master/logo/logo-on-dark-bg.svg">svg</a> | <a href="https://github.com/webpack/media/blob/master/logo/logo-on-dark-bg.png">png</a> | <a href="https://github.com/webpack/media/blob/master/logo/logo-on-dark-bg.jpg">jpg</a></p>\n<blockquote class="tip">\n<p>请尽可能的使用<strong>图标 + 文本</strong>的组合方式。</p>\n</blockquote>\n<h2 id="只包含图标">只包含图标<a href="#%E5%8F%AA%E5%8C%85%E5%90%AB%E5%9B%BE%E6%A0%87" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><strong>图标旨在用于布局有限的区域。如前所述，最好选择 图标+文字 的组合方式。</strong></p>\n<img src="https://raw.githubusercontent.com/webpack/media/master/logo/icon.png" width="250" alt="icon example">\n<p><a href="https://github.com/webpack/media/blob/master/logo/icon.svg">svg</a> | <a href="https://github.com/webpack/media/blob/master/logo/icon.png">png</a> | <a href="https://github.com/webpack/media/blob/master/logo/icon.jpg">jpg</a></p>\n<p>适用于较大区域的正方形尺寸图标（例如头像或个人图片）：</p>\n<img src="https://raw.githubusercontent.com/webpack/media/master/logo/icon-square-big.png" width="250" alt="icon square big example">\n<p><a href="https://github.com/webpack/media/blob/master/logo/icon-square-big.svg">svg</a> | <a href="https://github.com/webpack/media/blob/master/logo/icon-square-big.png">png</a> | <a href="https://github.com/webpack/media/blob/master/logo/icon-square-big.jpg">jpg</a></p>\n<p>适用于较小区域的正方形尺寸图标（例如，favicon）：</p>\n<img src="https://raw.githubusercontent.com/webpack/media/master/logo/icon-square-small.png" width="50" alt="icon square small example">\n<p><a href="https://github.com/webpack/media/blob/master/logo/icon-square-small.svg">svg</a> | <a href="https://github.com/webpack/media/blob/master/logo/icon-square-small.png">png</a> | <a href="https://github.com/webpack/media/blob/master/logo/icon-square-small.jpg">jpg</a></p>\n<blockquote class="tip">\n<p>对于那些遵循我们的指南，并已经深入了解的人，我们还制作了一个专门用于自定义 emoji 符号的特殊小尺寸图片（例如，在 slack 或 gitter 频道 ;)）。</p>\n</blockquote>\n<img src="/assets/icon-square-small-slack.png" width="50" alt="icon square small example">\n<h2 id="字体">字体<a href="#%E5%AD%97%E4%BD%93" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p>我们使用由一群极具天赋的人所设计的 <a href="http://atipofoundry.com/">Atipo Foundry</a> 这款漂亮字体，它来自 <a href="http://atipofoundry.com/fonts/geomanist">Geomanist Medium</a> 这个网站，并通过“随你付”的模式来提供完整的字体族。</p>\n<h2 id="调色板">调色板<a href="#%E8%B0%83%E8%89%B2%E6%9D%BF" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p>在 <a href="https://opencollective.com/">Open Collective</a> 和 <a href="https://medium.com/u/840563ee2a56">Threadless</a> 的帮助下，以下颜色在我们整个网站中被以各种组合形式使用，并且在 <a href="https://webpack.threadless.com/collections/the-final-release-collection/">webpack 官方商城</a> 推出的时尚服装系列中也用了这些颜色！</p>\n<table>\n<thead>\n<tr>\n<th>颜色名称</th>\n<th>HEX 码</th>\n<th>RGB 码</th>\n<th>示例</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><div class="title"><p>颜色名称</p><p>HEX 码</p><p>RGB 码</p><p>示例</p></div>\n<div class="content"><p>Malibu:<p class="description mobile">HEX <code>#8dd6f9</code></p></p></div></td>\n<td class="description desktop">HEX \n<code>#8dd6f9</code></td>\n<td><code>rgb: 141, 214, 249</code></td>\n<td><div style="background-color: #8dd6f9;">\n \n</div></td>\n</tr>\n<tr>\n<td><div class="title"><p>颜色名称</p><p>HEX 码</p><p>RGB 码</p><p>示例</p></div>\n<div class="content"><p>Denim:<p class="description mobile">HEX <code>#1d78c1</code></p></p></div></td>\n<td class="description desktop">HEX \n<code>#1d78c1</code></td>\n<td><code>rgb: 29, 120, 193</code></td>\n<td><div style="background-color: #1d78c1;">\n \n</div></td>\n</tr>\n<tr>\n<td><div class="title"><p>颜色名称</p><p>HEX 码</p><p>RGB 码</p><p>示例</p></div>\n<div class="content"><p>Fiord:<p class="description mobile">HEX <code>#465E69</code></p></p></div></td>\n<td class="description desktop">HEX \n<code>#465E69</code></td>\n<td><code>rgb: 70, 94, 105</code></td>\n<td><div style="background-color: #465E69;">\n \n</div></td>\n</tr>\n<tr>\n<td><div class="title"><p>颜色名称</p><p>HEX 码</p><p>RGB 码</p><p>示例</p></div>\n<div class="content"><p>Outer Space:<p class="description mobile">HEX <code>#2B3A42</code></p></p></div></td>\n<td class="description desktop">HEX \n<code>#2B3A42</code></td>\n<td><code>rgb: 43, 58, 66</code></td>\n<td><div style="background-color: #2B3A42;">\n \n</div></td>\n</tr>\n<tr>\n<td><div class="title"><p>颜色名称</p><p>HEX 码</p><p>RGB 码</p><p>示例</p></div>\n<div class="content"><p>White:<p class="description mobile">HEX <code>#ffffff</code></p></p></div></td>\n<td class="description desktop">HEX \n<code>#ffffff</code></td>\n<td><code>rgb: 255, 255, 255</code></td>\n<td><div style="background-color: #ffffff;">\n \n</div></td>\n</tr>\n<tr>\n<td><div class="title"><p>颜色名称</p><p>HEX 码</p><p>RGB 码</p><p>示例</p></div>\n<div class="content"><p>Concrete:<p class="description mobile">HEX <code>#f2f2f2</code></p></p></div></td>\n<td class="description desktop">HEX \n<code>#f2f2f2</code></td>\n<td><code>rgb: 242, 242, 242</code></td>\n<td><div style="background-color: #f2f2f2;">\n \n</div></td>\n</tr>\n<tr>\n<td><div class="title"><p>颜色名称</p><p>HEX 码</p><p>RGB 码</p><p>示例</p></div>\n<div class="content"><p>Alto:<p class="description mobile">HEX <code>#dedede</code></p></p></div></td>\n<td class="description desktop">HEX \n<code>#dedede</code></td>\n<td><code>rgb: 222, 222, 222</code></td>\n<td><div style="background-color: #dedede;">\n \n</div></td>\n</tr>\n<tr>\n<td><div class="title"><p>颜色名称</p><p>HEX 码</p><p>RGB 码</p><p>示例</p></div>\n<div class="content"><p>Dusty Gray:<p class="description mobile">HEX <code>#999999</code></p></p></div></td>\n<td class="description desktop">HEX \n<code>#999999</code></td>\n<td><code>rgb: 153, 153, 153</code></td>\n<td><div style="background-color: #999999;">\n \n</div></td>\n</tr>\n<tr>\n<td><div class="title"><p>颜色名称</p><p>HEX 码</p><p>RGB 码</p><p>示例</p></div>\n<div class="content"><p>Dove Gray:<p class="description mobile">HEX <code>#666666</code></p></p></div></td>\n<td class="description desktop">HEX \n<code>#666666</code></td>\n<td><code>rgb: 102, 102, 102</code></td>\n<td><div style="background-color: #666666;">\n \n</div></td>\n</tr>\n<tr>\n<td><div class="title"><p>颜色名称</p><p>HEX 码</p><p>RGB 码</p><p>示例</p></div>\n<div class="content"><p>Emperor:<p class="description mobile">HEX <code>#535353</code></p></p></div></td>\n<td class="description desktop">HEX \n<code>#535353</code></td>\n<td><code>rgb: 83, 83, 83</code></td>\n<td><div style="background-color: #535353;">\n \n</div></td>\n</tr>\n<tr>\n<td><div class="title"><p>颜色名称</p><p>HEX 码</p><p>RGB 码</p><p>示例</p></div>\n<div class="content"><p>Mine Shaft:<p class="description mobile">HEX <code>#333333</code></p></p></div></td>\n<td class="description desktop">HEX \n<code>#333333</code></td>\n<td><code>rgb: 51, 51, 51</code></td>\n<td><div style="background-color: #333333;">\n \n</div></td>\n</tr>\n</tbody>\n</table>\n<p>此外，你可以直接从下面的链接，获取这些类型的文件：</p>\n<p><a href="https://raw.githubusercontent.com/webpack/media/master/design/webpack-palette.psd">psd</a> | <a href="https://raw.githubusercontent.com/webpack/media/master/design/webpack-palette.png">png</a>\n| <a href="https://raw.githubusercontent.com/webpack/media/master/design/webpack-palette.ai">ai</a> | <a href="https://raw.githubusercontent.com/webpack/media/master/design/webpack-palette.svg">svg</a></p>\n<h2 id="许可证">许可证<a href="#%E8%AE%B8%E5%8F%AF%E8%AF%81" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p>logo 和品牌名称<strong>并不遵循 MIT 许可</strong>。请查看我们的<a href="https://github.com/webpack/media/blob/master/LICENSE">许可证</a>页面，以获取使用指南。</p>\n'}}]);